  * el.events = {
  *   click: {
  *     value: '',
  *     modifiers: modifiers
  *   },
  *   input: [{
  *     value: '',
  *     modifiers: modifiers
  *   }]
  * }
  * 
  * */
  if (Array.isArray(handlers)) {
    important ? handlers.unshift(newHandler) : handlers.push(newHandler)
  } else if (handlers) {
    events[name] = important ? [newHandler, handlers] : [handlers, newHandler]
